pub enum Error {

    /// Exact cause of failure is unknown
    Unspecified,

    /// The clock has either stopped or never started
    NotRunning,
}

pub enum TimeError {

    /// Exact cause of failure is unknown
    Unspecified,

    /// Attempted type conversion failed
    ConversionFailure,

    /// Result is outside of those valid for this type
    Overflow,

    /// Attempted to divide by zero
    DivByZero,

    /// Resulting [`Duration`](duration/trait.Duration.html) is negative (not allowed)
    NegDuration,

    /// [`Clock`]-implementation-specific error
    Clock(clock::Error),
}

pub enum ConversionError {

    /// Exact cause of failure is unknown
    Unspecified,

    /// Attempted type conversion failed
    ConversionFailure,

    /// Result is outside of those valid for this type
    Overflow,

    /// Attempted to divide by zero
    DivByZero,

    /// Resulting [`Duration`](duration/trait.Duration.html) is negative (not allowed)
    NegDuration,
}
